import "./App.css";
import Main from "./components/Main";
import Nav from "./components/Nav";
import Head from "./components/Head";
import Footer from "./components/Footer";

function App() {
  return (
    <div className="body">
      <Nav />
      <Head />
      <Main />
      <Footer />
    </div>
  );
}

export default App;
